      const[selected,setSelected]=useState("featured");

  const list=[
    {
      id: "featured",
      title: "Featured",
    },

    {
      id: "web",
      title: "Web App",
    },

    {
      id: "mobile",
      title: "Mobile App",
    },

    {
      id: "design",
      title: "Design",
    },

    {
      id: "content",
      title: "Content",
    },
  ];
  return (
    <div className="portofolio" id="portofolio">
        <h1>Fotografii</h1>

